import { useState } from "react";
import "./EmailBlock.scss";

export const EmailBlock = () => {
  const [value, setValue] = useState("");
  return (
    <div className="emailBlockContainer">
      <input
        placeholder="Your email"
        type="email"
        value={value}
        onChange={(e) => setValue(e.target.value)}
      />
    </div>
  );
};
